import React, { Component } from "react";
import PropTypes from "prop-types";
import { Card, CardContent, CardActions, Typography, CardMedia, withStyles } from "@material-ui/core";

const styles = theme => ({
    card: {
        display: "block",
        margin: 5,
        [theme.breakpoints.up("sm")]: {
            display: "flex"
        },
        borderRadius: 0
    },
    caption: {
        textTransform: "uppercase"
    },
    title: {
        textTransform: "uppercase",
        color: theme.palette.primary.main,
        fontWeight: "bold"
    },
    media: {
        width: "auto",
        height: 300,
        [theme.breakpoints.up("sm")]: {
            width: 1500
        },
        flexBasis: "50%"
    },
    content: {
        display: "flex",
        flexDirection: "column",
        flexBasis: "50%",
        backgroundColor: "#eee"
    },
    cardText: {
        flex: "1 0 auto",
        marginBottom: 15,
        [theme.breakpoints.up("sm")]: {
            marginBottom: 0
        }
    },
    linkAction: {
        textDecoration: "none",
        textTransform: "uppercase",
        color: theme.palette.primary.main,
        fontWeight: "bold"
    }
});

class CardComponent extends Component {
    render() {
        const { classes, } = this.props;
        return (
            <Card className={classes.card}>

            </Card>
        );
    }
}

CardComponent.propTypes = {
    classes: PropTypes.object.isRequired
};

export default withStyles(styles)(CardComponent);
